def generate_odd_fibonacci_numbers(n, min_val, max_val):
    """"""
    fib_sequence = []
    (a, b) = (0, 1)
    while len(fib_sequence) < n:
        (a, b) = (b, a + b)
        if a > max_val:
            break
        if a > min_val and a % 2 != 0:
            fib_sequence.append(a)
